  [],\n\t\"revision_timestamp\": \"2015-09-26T19:55:57.411479\",\n\t\"name\": \"climate-prediction-center-cpc-three-month-probabilistic-precipitation-outlook-for-the-contiguou\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Climate Prediction Center (CPC) issues
  a series of thirteen probabilistic three-month precipitation outlooks for the United
  States. CPC issues the thirteen outlooks each month with lead times from 0.5 months
  to 12.5 months. For example, in mid-January, CPC will issue Three-Month Precipitation
  Outlooks for February through April, March through May, April through June, and
  so on into February through April of the following year. A new set of outlooks would
  then be released in mid-February for March through May, April through June, and
  so on into March through May of the following year. CPC expresses the outlooks in
  a 3-category probabilistic format as the chance the total precipitation for the
  period will be above, below, or near median. CPC bases its definition of above median,
  near median, and below median by fitting a Gamma distribution to a thirty year climatology
  and dividing this distribution into equally likely thirds. Note that the base period
  for the thirty year climatology (currently beginning in 1981 and ending in 2010)
  is updated once per decade. CPC indicates the probability of the most likely category
  with shaded contours and labels the centers of maximum probability with the letters
  \"A\" (for Above Median), \"B\" (for Below Median), or \"N\" (for Near Median).
  For areas where a favored category cannot be determined, CPC indicates those areas
  with an \"EC\" meaning \"Equal Chances\". CPC also accompanies the outlook maps
  with a technical discussion of the meteorological and climatological basis for the
  outlooks. CPC may include analysis of statistical and numerical models, meteorological
  and sea-surface temperature patterns, trends and past analogs, and confidence factors
  in this technical discussion.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
